    EditTripLocation.prototype.changeLatLng = function (points) {
        console.log(points);
        var polyPoints = [];
        for (var i = 0; i < points.length; i++) {
            polyPoints.push({ lat: points[i].latitude, lng: points[i].longitude });
        }
        return polyPoints;
    };
