    VehicleTripStatusDetails.prototype.msToTime = function (duration) {
        var x = duration / 1000;
        var seconds = Math.floor(x % 60);
        x /= 60;
        var minutes = Math.floor(x % 60);
        x /= 60;
        var hours = Math.floor(x % 24);
        x /= 24;
        var days = Math.floor(x);
        // console.log(days);
        var totalDuration = '';
        if (days > 0) {
            totalDuration = days + "d ";
        }
        if (hours > 0) {
            totalDuration = totalDuration + hours + "hr ";
        }
        if (days >= 1) {
            return totalDuration;
        }
        if (minutes > 0) {
            return totalDuration = totalDuration + minutes + "min";
        }
        if (seconds > 0 && totalDuration == '') {
            totalDuration = totalDuration + seconds + " sec";
        }
        if (totalDuration == '') {
            return '0 sec';
        }
        else {
            return totalDuration;
        }
    }; //close methods msToTime
